import React from 'react'; 

const User = ({name, entries}) =>{
    return(
        <div>
            <div className="white f3 center textce">
                {`${name}, tu nivel actual es...`}
            </div>
            <div className="white f1 textce">
                {entries}
            </div>
        </div>
    )
}

export default User;
